CREATE DEFINER=`root`@`localhost` PROCEDURE `1register0`(IN patientIDNumber1 char(19),IN patientName1 text CHARACTER SET UTF8,IN patientSex1 char(10),IN patientBirthday1 date,IN patientAge1 int(10),IN patientAgeType1 text CHARACTER SET UTF8,IN patientAddress1 text CHARACTER SET UTF8,IN dateOfConsultation1 date,IN noon1 char(10) CHARACTER SET UTF8,IN departmentID1 char(30),IN doctorID1 char(30),IN registeredGradeID1 char(30),IN settlementCategory1 char(30),IN medicalRecordNeeded1 char(10),IN registeredStaffID1 char(30),OUT result char(30))
BEGIN
	#Routine body goes here...
	DECLARE medicalRecordNumber1 int(30);	
	DECLARE deletedMark1 char(10);
	DECLARE registrationTime1 timestamp;
	DECLARE statusOfConsultation1 char(10);
	DECLARE registrationID1 char(30);
	DECLARE registrationFee1 double(20,2);
	DECLARE invoicesAmount1 double(20,2);
	DECLARE s1 char(30);
	DECLARE s2 char(30);
	SET s1='success!';
	SET s2='failure!';
	#获取当前时间用于作为本次挂号时间字段
	select FROM_UNIXTIME(UNIX_TIMESTAMP(NOW()),'%Y-%m-%d %H:%i:%S') INTO registrationTime1;
	#默认deletedMark1为1
	SET deletedMark1='1';
	#初始化statusOfConsultation1为1
	SET statusOfConsultation1='1';
	#查询该患者信息是否存在，存在则取病历号并刷新患者信息，不存在则自动生成病历号并插入患者信息到01patients
	IF EXISTS(SELECT medicalRecordNumber FROM 01patients WHERE patientIDNumber LIKE patientIDNumber1)THEN 
		SET medicalRecordNumber1=(SELECT medicalRecordNumber FROM 01patients WHERE patientIDNumber LIKE patientIDNumber1);
		UPDATE 01patients SET medicalRecordNumber=medicalRecordNumber1,patientIDNumber=patientIDNumber1,patientName=patientName1,patientSex=patientSex1,patientBirthday=patientBirthday1,patientAge=patientAge1,patientAgeType=patientAgeType1,patientAddress=patientAddress1,deletedMark=deletedMark1 WHERE medicalRecordNumber=medicalRecordNumber1;
	ELSE SET medicalRecordNumber1=(SELECT medicalRecordNumber FROM 01patients ORDER BY medicalRecordNumber DESC LIMIT 1)+1;
	END IF;
	#插入挂号信息到14registrationForm
	#查询挂号ID
	SELECT registrationID INTO registrationID1 FROM 14registrationForm WHERE medicalRecordNumber=medicalRecordNumber1 AND registrationTime=registrationTime1;
	#计算挂号金额
	IF medicalRecordNeeded1 LIKE '1' THEN
		SET invoicesAmount1=1;
	ELSE SET invoicesAmount1=0;
	END IF;
	SELECT registrationFee INTO registrationFee1 FROM 13registeredgrades WHERE registeredGradeID=registeredGradeID1;
	SET invoicesAmount1=invoicesAmount1+registrationFee1;
	#将挂号消费存入发票中
	SET result=s1;
END
;;
DELIMITER ;

