-- ----------------------------
-- Procedure structure for 4prescribing
-- ----------------------------
DROP PROCEDURE IF EXISTS `4prescribing`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `4prescribing`(IN registrationID1 int (30),IN prescriptionName1 char(30),IN drugIDList1 char(100),IN drugUsageList1 char(100),IN drugDosageList1 char(100),IN frequencyList1 char(100),IN quantityList1 char (100),OUT result char(30))
BEGIN
	#Routine body goes here...
	DECLARE medicalRecordID1 int(30);
	DECLARE doctorID1 int(30);
	DECLARE prescriptionID1 int(30);
	DECLARE prescriptionTime1 timestamp;
	DECLARE prescriptionStatus1 char(10);
	DECLARE drugID1 int(30);
	DECLARE drugUsage1 char(30);
	DECLARE drugDosage1 char(30);
	DECLARE frequency1 char(30);
	DECLARE quantity1 int(10);
	DECLARE drugStatus1 char(10);
	DECLARE len int(10);
 	DECLARE num int(10);
	DECLARE a char(30);
	DECLARE s1 char(30);
	DECLARE s2 char(30);
	SET s1='success!';
	SET s2='failure!';

	#查询挂号状态
	IF EXISTS(SELECT statusOfConsultation FROM 14registrationForm WHERE registrationID=registrationID1) THEN (SELECT statusOfConsultation INTO a FROM 14registrationForm WHERE registrationID=registrationID1);
		#条件判断是否可以开药		
		IF a LIKE '2' OR '3' THEN
			#根据挂号ID得到medicalRecordID1和doctorID1
			SELECT doctorID INTO doctorID1 FROM 14registrationForm WHERE registrationID=registrationID1;
			SELECT medicalRecordID INTO medicalRecordID1 FROM 15medicalrecordForm WHERE registrationID=registrationID1;
			#获取当前时间用于作为本次开立时间字段
			SELECT FROM_UNIXTIME(UNIX_TIMESTAMP(NOW()),'%Y-%m-%d %H:%i:%S') INTO prescriptionTime1;
			#设定处方和处方明细的状态为开立
			SET prescriptionStatus1='1';
			SET drugStatus1='1';
			#将处方的基本信息保存到处方表
			SET num=(SELECT count(prescriptionID) FROM 17prescription WHERE registrationID=registrationID1)-1;
			SELECT prescriptionID INTO prescriptionID1 FROM 17prescription WHERE registrationID=registrationID1 LIMIT num,1;
			#划分字符串，并将处方明细保存到处方明细表
			SELECT LENGTH(drugIDList1)-LENGTH(REPLACE(drugIDList1,',',''))+1 INTO len;
			WHILE len>0 DO
				START TRANSACTION;
				SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(drugIDList1,',',-len),',',1) INTO drugID1;
				SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(drugUsageList1,',',-len),',',1) INTO drugUsage1;
				SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(drugDosageList1,',',-len),',',1) INTO drugDosage1;
				SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(frequencyList1,',',-len),',',1) INTO frequency1;
				SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(quantityList1,',',-len),',',1) INTO quantity1;
				SELECT CONVERT(drugID1,UNSIGNED INTEGER) INTO drugID1;
				SELECT CONVERT(quantity1,UNSIGNED INTEGER) INTO quantity1;
				SET len=len-1;
			END WHILE;
			#更新挂号状态为3
			UPDATE 14registrationForm SET statusOfConsultation='3' WHERE registrationID=registrationID1;
			SET result=s1;
		ELSE SET result=s2;
		END IF;
	ELSE SET result=s2;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for 5pay
-- ----------------------------
DROP PROCEDURE IF EXISTS `5pay`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `5pay`(IN prescriptionID1 char(30),IN chargingOrRefundStaffID1 char(30),IN chargingMethod1 char(30),OUT result char(30))
BEGIN
	#Routine body goes here...
	DECLARE prescriptionDetailID1 int(30);
	DECLARE prescriptionStatus1 char(10);
 	DECLARE drugStatus1 char(10);
 	DECLARE invoiceAmount1 double(20,2);
 	DECLARE chargingOrRefundTime1 timestamp;
 	DECLARE registrationID1 char(30);
 	DECLARE unitPriceOfDrugs1 double(20,2);
 	DECLARE quantity1 int(10);
 	DECLARE invoiceNumber1 int(30);
 	DECLARE itemID1 int(30);
 	DECLARE itemCategory1 char(30);
 	DECLARE itemName1 char(30);
 	DECLARE executiveDepartmentsID1 char(30);
	DECLARE a char(30);
 	DECLARE num int(10);
	DECLARE s1 char(30);
	DECLARE s2 char(30);
	SET s1='success!';
	SET s2='failure!';

	#初始化发票金额为0.00
	SET invoiceAmount1=0.00;
	#获取当前时间用于作为本次收/退费时间字段
	SELECT FROM_UNIXTIME(UNIX_TIMESTAMP(NOW()),'%Y-%m-%d %H:%i:%S') INTO chargingOrRefundTime1;
	#根据处方ID获得挂号ID
	SELECT registrationID INTO registrationID1 FROM 17prescription WHERE prescriptionID=prescriptionID1;
	#查询处方状态
	IF EXISTS(SELECT prescriptionStatus FROM 17prescription WHERE prescriptionID=prescriptionID1) THEN (SELECT prescriptionStatus INTO a FROM 17prescription WHERE prescriptionID=prescriptionID1);
		#条件判断是否可以缴费	
		IF a LIKE '1' THEN
			#更新处方为已缴费
			SET prescriptionStatus1='2';
			UPDATE 17prescription SET prescriptionStatus=prescriptionStatus1 WHERE prescriptionID=prescriptionID1;
			#查询该处方ID对应的处方明细ID的数量
			SET num=(SELECT count(prescriptionDetailID) FROM 18prescriptionDetails WHERE prescriptionID=prescriptionID1)-1;
			WHILE num>=0 DO
				#根据处方ID得到处方明细ID,明细状态
				SELECT prescriptionDetailID,drugStatus INTO prescriptionDetailID1,drugStatus1 FROM 18prescriptionDetails WHERE prescriptionID=prescriptionID1 LIMIT num,1;
				IF drugStatus1='1' THEN
					#更新处方明细表相关药品的状态为已缴费
					SET drugStatus1='2';
					UPDATE 18prescriptionDetails SET drugStatus=drugStatus1 WHERE prescriptionDetailID=prescriptionDetailID1;
					#获得该条处方明细的药品单价和数量
					SELECT drugID,quantity INTO itemID1,quantity1 FROM 18prescriptionDetails WHERE prescriptionDetailID=prescriptionDetailID1;
					SELECT unitPriceOfDrugs INTO unitPriceOfDrugs1 FROM 06drugs where drugID=itemID1;
					#更新发票金额
					SET invoiceAmount1=invoiceAmount1+unitPriceOfDrugs1*quantity1;
				ELSE SET result=s2;
				END IF;
				SET num=num-1;
			END WHILE;		
			#新增发票记录
			#将每一条药品的缴费信息保存到缴费明细表中
			SET executiveDepartmentsID1='132';
			SELECT invoiceNumber INTO invoiceNumber1 FROM 22invoices WHERE registrationID=registrationID1 AND chargingOrRefundTime=chargingOrRefundTime1;
			SET num=(SELECT count(prescriptionDetailID) FROM 18prescriptionDetails WHERE prescriptionID=prescriptionID1)-1;
			WHILE num>=0 DO
				SELECT prescriptionDetailID INTO prescriptionDetailID1 FROM 18prescriptionDetails WHERE prescriptionID=prescriptionID1 LIMIT num,1;
				SELECT drugID,quantity INTO itemID1,quantity1 FROM 18prescriptionDetails WHERE prescriptionDetailID=prescriptionDetailID1;
				SELECT unitPriceOfDrugs,drugType,drugName INTO unitPriceOfDrugs1,itemCategory1,itemName1 FROM 06drugs where drugID=itemID1;
				SET num=num-1;
			END WHILE;	
			SET result=s1;
		ELSE SET result=s2;
		END IF;
	ELSE SET result=s2;
	END IF;
END
;;
DELIMITER ;

