			SELECT invoiceAmount,registrationID INTO invoiceAmount1,registrationID1 FROM 22invoices WHERE invoiceNumber=invoiceNumber1;
			#新增重开发票记录
			IF invoiceAmount2>0 THEN
			END IF;
			#原发票有效状态更新为报废
			UPDATE 22invoices SET effectiveStatus='2' WHERE invoiceNumber=invoiceNumber1;
			SET result=s1;
		ELSE SET result=s2;
		END IF;
	ELSE SET result=s2;
	END IF;
END
