DROP PROCEDURE IF EXISTS `7dispensing`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `7dispensing`(IN medicalRecordNumber1 int(30),OUT result char(30))
BEGIN
	#Routine body goes here...
	DECLARE medicalRecordID1 char(30);
	DECLARE prescriptionID1 char(30);
	DECLARE prescriptionStatus1 char(10);
 	DECLARE drugStatus1 char(10);
	DECLARE a char(30);
 	DECLARE num int(10);
	DECLARE s1 char(30);
	DECLARE s2 char(30);
	SET s1='success!';
	SET s2='failure!';

	SET result=s1;
	#查询该病历号对应的病历ID
  SELECT medicalRecordID INTO medicalRecordID1 FROM 15medicalrecordform WHERE medicalRecordNumber=medicalRecordNumber1;
	#查询该病历ID对应的处方ID的数量
	SET num=(SELECT count(prescriptionID) FROM 17prescription WHERE medicalRecordID=medicalRecordID1)-1;
	WHILE num>=0 DO
		#根据病历ID查询处方ID
		SELECT prescriptionID INTO prescriptionID1 FROM 17prescription WHERE medicalRecordID=medicalRecordID1 LIMIT num,1;
		#查询处方状态
		SELECT prescriptionStatus INTO a FROM 17prescription WHERE prescriptionID=prescriptionID1;
		#条件判断是否可以发药
		IF a LIKE '2' THEN
			#更新处方为已处理
			SET prescriptionStatus1='3';
			UPDATE 17prescription SET prescriptionStatus=prescriptionStatus1 WHERE prescriptionID=prescriptionID1;
			#更新处方明细表相关药品的状态为已发药
			SET drugStatus1='3';
			UPDATE 18prescriptionDetails SET drugStatus=drugStatus1 WHERE prescriptionID=prescriptionID1;
		ELSE SET result=s2;
		END IF;
		SET num=num-1;
	END WHILE;	
END
;;
DELIMITER ;
